import React from 'react'
import {NavLink} from 'react-router-dom'

function NavBar() {
  return (
    <div className='NV'>
    <NavLink to="/"/>
    <NavLink to="home">HOME</NavLink> 
    <NavLink to="watch">WATCHLIST</NavLink>
    </div>
  )
}

export default NavBar
